import React from "react";
import ReactDOM from "react-dom";

const img = "https://picsum.photos/200/300";

function Image(){
  return <img src={img + "?grayscale"} />;
}

ReactDOM.render(
  <div>
    <h1 className="heading">Some food</h1>
    <div>
      <Image />
    </div>
  </div>,
  document.getElementById("root")
);
